  false,\n\t\"url\": null,\n\t\"notes\": \"In order to apply a landscape-scale approach
  to management of the lands, natural communities of the West Mountain Wildlife Management
  Area and Nulhegan Basin Wildlife Refuge were inventoried and mapped. Simultaneous
  with natural community mapping, an inventory of rare, uncommon and invasive vascular
  plants was conducted. The results of that work are presented in this report including
  detailed lists and descriptions of these plants.\",\n\t\"license_title\": \"License
